/*
	Crazy stuff?!

	BONUS:
		Thanks to Erik Darling for showing this one.
		Source: https://erikdarlingdata.com/t-sql-tuesday-cool-query-transforms-cool-query-plans-tsqltuesday
*/
DROP INDEX p ON dbo.Posts
GO

CREATE INDEX 
    p 
ON dbo.Posts
    (OwnerUserId, CreationDate DESC)
WITH
    (SORT_IN_TEMPDB = ON, DATA_COMPRESSION = PAGE);
GO


-- What most of us would be writing 
SELECT TOP (1000)
    p.*
FROM dbo.Posts AS p
WHERE p.OwnerUserId IN (22656, 29407, 157882)
ORDER BY 
    p.CreationDate DESC;










/*
	Some crazier people would go with
*/
SELECT TOP (1000)
		p.*
  FROM 
		(
			VALUES 
				(22656), 
				(29407), 
				(157882)
		) AS x (x)
		CROSS APPLY
		(
			SELECT TOP (1000)
				p.*
			FROM dbo.Posts AS p
			WHERE p.OwnerUserId = x.x
			ORDER BY p.CreationDate DESC
		) AS p
ORDER BY p.CreationDate DESC;







/*
	Would you ever think on this one?
*/
SELECT TOP (1000)
		p.*
  FROM dbo.Posts AS p
 WHERE p.OwnerUserId IN (SELECT 22656 
						UNION 
						SELECT 29407 
						UNION 
						SELECT 157882
					   )
ORDER BY p.CreationDate DESC;


/*****************************************************************************************************
	Bottom line:
		Having a "beautiful" plan and/or with less operators plans doesn't mean it will be faster!
*****************************************************************************************************/













